  console.log(crimeData, "test crime data");

  console.log(postcode, "test postcode");

  useEffect(() => {
    axios
      .get("https://api.getthedata.com/postcode/E18+1el")
      .then((response) => {
        setPostCode(response.data);
      })
      .catch((error) => {
        console.error(error, "Error fetching data");
      });
  }, []);

